import Layout from "../components/Layout";
import styles from "../styles/index.module.css";

const Index = () => (
  <Layout>
    <div className={styles.container}>
      <div className={avatar}>Hello</div>
      <div className={introtext}>Hello</div>
    </div>
  </Layout>
);

export default Index;
